import './App.css';
import Image from './components/Image/Image';
import Header from './components/Header/Header';
import Mailing from './components/Mailing/Mailing';
import WebSite from './components/WebSite/WebSite';

function App() {
  return (
    <div className="App">
      <Image />
      <Header />
      <div className='flex'>
        <Mailing />
        <WebSite />
      </div>
    </div>
  );
}

export default App;
